// Create a test fixture for IAB Renderer API tests
    
    // googleTest test fixture: derive a class from testing::Test.
    class IABVABPRendererPointSourceTest : public testing::Test
    {
    protected:
        
        // virtual void SetUp() to init variables
        virtual void SetUp71()
        {
            rendererConfig_ = RenderUtils::IRendererConfigurationFile::FromBuffer((char*) c71cfg.c_str());
            
            ASSERT_TRUE(rendererConfig_ != NULL);
            
            std::vector<RenderUtils::RenderSpeaker>::const_iterator iterA;
            const std::vector<RenderUtils::RenderSpeaker>*	speakerList;
            
            ASSERT_EQ(kNoRendererConfigurationError, rendererConfig_->GetSpeakers(speakerList));
            ASSERT_GT((*speakerList).size(), 0);
            speakerCount_ = static_cast<uint32_t>((*speakerList).size());
            
            ASSERT_EQ(kNoRendererConfigurationError, rendererConfig_->GetChannelCount(channelCount_));
            
            ASSERT_EQ(9, speakerCount_);
            ASSERT_EQ(8, channelCount_);
            
            renderer_ = new IABVBAP::VBAPRenderer();
            ASSERT_TRUE(renderer_ != NULL);
            
            ASSERT_EQ(kVBAPNoError, renderer_->InitWithConfig(rendererConfig_));
        }
        
        virtual void SetUp()
        {
			rendererConfig_ = NULL;
			channelCount_ = 0;
			speakerCount_ = 0;

			audioSamples_ = NULL;

			SetUp71();
        }
        
        // virtual void TearDown() to do any clean-up
        virtual void TearDown()
        {
            if (rendererConfig_)
            {
                delete rendererConfig_;
            }
            
            if (renderer_)
            {
                delete renderer_;
            }
            
            delete[] audioSamples_;
        }
        
        IABVBAP::vbapError SetupExtendSource(float radius, float azimuth, float elevation, float gain, IABVBAP::vbapRendererExtendedSource *extendedSource)
        {
            // Convert Polar back to Cartesian
            float oX = radius * cos(elevation) * sin(azimuth);
            float oY = radius * cos(elevation) * cos(azimuth);
            float oZ = radius * sin(elevation);
            IABVBAP::vbapPosition vbapPosition(oX, oY, oZ);
            
            // Create a VBAP extended source
            IABVBAP::vbapError vbapReturnCode = extendedSource->SetGain(gain);
            vbapReturnCode = extendedSource->SetPosition(vbapPosition);
            
            return vbapReturnCode;
        }
        
        // Test will loop through given VBAP Reference data co-ordinates, creates a vBAP object and renders it.
        // The renderered output speaker gains are compared with reference data.
        // The TOL_VBAP_CH_GAIN_DIFFERENCE is expected as cross platform floating point calculations and floating point usage
        virtual void TestObjectPointSourceRendering()
        {
            ASSERT_TRUE(renderer_ != NULL);
            
            for (uint32_t i = 0; i < sizeof(VBAPReferenceData71)/sizeof(VBAPReferenceData71[0]); i++)
            {
                
                IABVBAP::vbapRendererObject *object = new IABVBAP::vbapRendererObject(channelCount_);
                
                IABVBAP::vbapRendererExtendedSource *extendedSource = new IABVBAP::vbapRendererExtendedSource(speakerCount_, channelCount_);
            
                // Input x, y, z parameters.
                float x = VBAPReferenceData71[i][3];
                float y = VBAPReferenceData71[i][4];
                float z = VBAPReferenceData71[i][5];

                IABVBAP::vbapPosition iPosition( x, y, z );
                extendedSource->SetPosition(iPosition);

				// aperture and divergence left at default values, both 0.0f
            
                // ID
                uint32_t id = 1;
                
                EXPECT_EQ(kVBAPNoError, object->SetId(id));

				// Add the entended source, as the single on-dome source, to object
				object->extendedSources_.push_back(*extendedSource);

                EXPECT_EQ(kVBAPNoError, renderer_->RenderObject(object));
                
                EXPECT_LE_TOLERENCE(object->channelGains_.at(0), VBAPReferenceData71[i][6], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(1), VBAPReferenceData71[i][7], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(2), VBAPReferenceData71[i][8], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(3), VBAPReferenceData71[i][9], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(4), VBAPReferenceData71[i][10], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(5), VBAPReferenceData71[i][11], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(6), VBAPReferenceData71[i][12], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(7), VBAPReferenceData71[i][13], TOL_VBAP_CH_GAIN_DIFFERENCE);

                delete object;
                delete extendedSource;
            }
        }
        
        // Test will loop through given VBAP Reference data co-ordinates, creates a vBAP object and renders it.
        // The renderered output speaker gains are compared with reference data.
        // The TOL_VBAP_CH_GAIN_DIFFERENCE is expected as cross platform floating point calculations and floating point usage
        virtual void TestObjectPointSourceRenderingForInteriorObject()
        {
            ASSERT_TRUE(renderer_ != NULL);
            
			float azimuth = 0.0f;
			float elevation = 0.0f;
			float gain = 0.0f;

			for (uint32_t i = 0; i < sizeof(VBAPReferenceData71Interior)/sizeof(VBAPReferenceData71Interior[0]); i++)
            {
                IABVBAP::vbapRendererObject *object = new IABVBAP::vbapRendererObject(channelCount_);
				IABVBAP::vbapRendererExtendedSource *extendedSource = new IABVBAP::vbapRendererExtendedSource(speakerCount_, channelCount_);

                // ID
                uint32_t id = 1;
                
                EXPECT_EQ(kVBAPNoError, object->SetId(id));
                
				// Set up 1st extended source, & add it to object
				azimuth = VBAPReferenceData71Interior[i][3];
				elevation = VBAPReferenceData71Interior[i][4];
				gain = VBAPReferenceData71Interior[i][5];
				SetupExtendSource(1.0f, azimuth, elevation, gain, extendedSource);
				// Add the 1st entended source to object
				object->extendedSources_.push_back(*extendedSource);

				// Set up 2nd extended source, & add it to object
				azimuth = VBAPReferenceData71Interior[i][6];
				elevation = VBAPReferenceData71Interior[i][7];
				gain = VBAPReferenceData71Interior[i][8];
				SetupExtendSource(1.0f, azimuth, elevation, gain, extendedSource);
				// Add the 2nd entended source to object
				object->extendedSources_.push_back(*extendedSource);

				// Set up 3rd extended source, & add it to object
				azimuth = VBAPReferenceData71Interior[i][9];
				elevation = VBAPReferenceData71Interior[i][10];
				gain = VBAPReferenceData71Interior[i][11];
				SetupExtendSource(1.0f, azimuth, elevation, gain, extendedSource);
				// Add the 3rd entended source to object
				object->extendedSources_.push_back(*extendedSource);

				EXPECT_EQ(kVBAPNoError, renderer_->RenderObject(object));

                EXPECT_LE_TOLERENCE(object->channelGains_.at(0), VBAPReferenceData71Interior[i][12], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(1), VBAPReferenceData71Interior[i][13], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(2), VBAPReferenceData71Interior[i][14], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(3), VBAPReferenceData71Interior[i][15], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(4), VBAPReferenceData71Interior[i][16], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(5), VBAPReferenceData71Interior[i][17], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(6), VBAPReferenceData71Interior[i][18], TOL_VBAP_CH_GAIN_DIFFERENCE);
                EXPECT_LE_TOLERENCE(object->channelGains_.at(7), VBAPReferenceData71Interior[i][19], TOL_VBAP_CH_GAIN_DIFFERENCE);
                
                delete object;
				delete extendedSource;
			}
        }

        
    private:
        
        /*
         * VBAPReferenceData71
         *
         * {radius, azimuth, elevation, x, y, z, L, C, R, LFE, LSS, RSS, LSR, RSR}
         *
         * So radius, azimuth, elevation are in fact the input parameters used in the reference generation program that
         * transformed into the x, y, z and they are present in the table just for information. They are not used by the unit
         * test.
         */
        static const float VBAPReferenceData71[148][14];
        
        
        /*
         * VBAPReferenceData71Interior
         *
         * (All co-ordinates in radians)
         *
         * first 3 arguments are co-ordinates of interior object, next 9 parameters are converted interior into 3 normalised mda object's parameters, next 8 arguments are rendered channel gains)
         *
         * {radius_interior, azimuth_interior, elevation_interior, azimuth_left, elevation_left, gain_left, azimuth_right, elevation_right, gain_right, azimuth_projected, elevation_projected, gain_projected, L, C, R, LFE, LSS, RSS, LSR, RSR}
         */
        static const float VBAPReferenceData71Interior[1309][20];

        
        // Handles to a list of Renderer entities
        IABVBAP::VBAPRenderer  *renderer_;
        RenderUtils::IRendererConfiguration *rendererConfig_;
        
        uint32_t channelCount_;
        uint32_t speakerCount_;
        
        float *audioSamples_;           // Input samples
    };

    
    // Test Object rendering API
    TEST_F(IABVABPRendererPointSourceTest, PointSourceObjecTest)
    {
        TestObjectPointSourceRendering();
    }

    TEST_F(IABVABPRendererPointSourceTest, InteriorPointSourceObjectTest)
    {
        TestObjectPointSourceRenderingForInteriorObject();
    }


